import Layout from "../../Containers/Layout";
import styles from './Home.module.scss';
import Background from '../images/background_image.png';
import React from 'react';
import 'antd/dist/antd.css';
import {Link} from 'react-router-dom';
// import { Button } from 'antd';
import { SearchOutlined, ScheduleOutlined } from '@ant-design/icons';

const content = (
    <div className={styles.container}>
        <p><img  className={styles.img} alt={'Background'} src={Background}/></p>
        {/* <button icon={<SearchOutlined/>} className={styles.buttons} active> 
            <Link className={styles.link} to={'../Doctors/Doctors' }> <p>Rezerva</p>
            </Link>
        </button> */}
        <button
            variant="contained"
            className={styles.button}
            size={'large'}>
                <p>Rezerva</p>
        </button>

    </div>
);

const App = () => {
    return (
        <Layout content={content}/>
    )
};
export default App;
